    <section>
      <Droppable droppableId={props.column_id}>
        {(provide) => {
          <div className="column">
            <TaskCard />
            <TaskCard />
            <TaskCard />
            <TaskCard />
          </div>;
        }}
      </Droppable>
    </section>
  );
}
